import React, { useState } from "react";
import Product from "../component/product";
import  "./cart.css";
export function Cart(props) {
  const [Cartproduct, setCartproduct] = useState([
    { name: "tshirt", price: "800", img: "product2.jpg" },
  ]);
  return (
    <section>
      <header>
        <h2 className="cart-header">Cart</h2>
      </header>
      <main className="cart-body">
          <div className="cart-product">
        <div className="cart-product-display">
          <div className="cart-product-img-container">
            <img className="cart-product-img" src="/products/product2.jpg" />
          </div>
          <div className="cart-ptoduct-name">Green full sleeve tshirt</div>
        </div>
        <div className="product-price">Rs.600</div>
        </div>
      </main>
    </section>
  );
}
